var tipuesearch = {"pages":[{"title":"About","text":"2017Spring 機械設計工程系網際內容管理 課程倉儲: http://github.com/mdecourse/2017springwcm 課程投影片: http://mdecourse.github.io/2017springwcm 課程網誌: http://mdecourse.github.io/2017springwcm/blog","url":"./pages/about/","tags":"misc"},{"title":"2017/04/06第七週","text":"","url":"./20170406di-qi-zhou.html","tags":"Course"},{"title":"2017/03/30第六週","text":"Onshape八連桿組合","url":"./20170330di-liu-zhou.html","tags":"Course"},{"title":"2017/03/23第五週","text":"利用v-rep設定單連桿運動 利用v-rep設定單連桿運動 心得: 透過老師的上課影片教學,可以讓我了解到 v-rep如何分解零件、設置旋轉軸、馬達....等!","url":"./20170323di-wu-zhou.html","tags":"Course"},{"title":"2017/03/16第四週","text":"","url":"./20170316di-si-zhou.html","tags":"Course"},{"title":"2017/03/09第三週","text":"翻譯影片 Hyperworks3 Optistuct's one of our focus area Optistuct是我們的重點領域之一 is nonlinear large deformation analysis and in 2017 we added nonlinear transient analysis the main purpose was to couple Acusolve and structure interaction but also one development that happens during the last year came 是非線性大變形分析，在2017年，我們添加了非線性瞬態分析，其主要目的是耦合Acusolve和結構的相互作用，但也發生在去年發生的一個發展 out these lights and different point releases and it's all really maturing in 2017 is our contact analysis we have different ways of defining large sliding contact and things like that the fast contact analysis for for small 這些燈和不同點的釋放，這一切都在2017年真正成熟是我們的聯繫分析我們有不同的方式來定義大滑動接觸和事情，如快速接觸分析為小 deformation is blazing fast at the very simple idea that makes a solution very fast and that adds to optistruct as really a leading nonlinear structural solver our two major optimization packages are optistruct 變形是快速的，在一個非常簡單的想法，使解決方案非常快，並增加了optistruct作為真正的領先的非線性結構解算器我們的兩個主要優化包是光 for structural optimization as a huge multidisciplinary component tools and hyperstudy for general optimization work on multidisciplinary optimization Optistruct spend a lot of time continuing the 結構優化作為一個巨大的多學科組件工具和hyperstudy對多學科優化的一般優化工作Optistruct花費大量的時間繼續 development for topology optimization and we have the wave topology optimization we kept on working on the manufacturing solution to designed optimization the multimodal optimization is really maturing and we find more and 拓撲優化的開發，我們有波拓撲優化，我們繼續致力於製造解決方案設計優化多模態優化是真正成熟的，我們發現更多， more applications where that help our goal is actually to include all the physics in the optimizations of the team right now is working on optimization for nonlinear problems and so on and then hyperstudy on the other hand is going 更多的應用程序，其中幫助我們的目標是實際上包括所有的物理在團隊的優化現在是工作在非線性問題的優化等等，然後hyperstudy另一方面是 through a new transformation of the user experience or the user experience has changed a few years back but we are now trying to make it much more easy to use by hiding a lot of the advanced functionality to the regular users and 通過用戶體驗的新轉型或用戶體驗已經改變了幾年，但是我們現在正試圖通過隱藏許多高級功能給常規用戶更容易使用， depending on the level of expertise or depending on the job that the user has to do they can customize the user experience he added a few new connection one of them is a flux connection such as the electromagnetic code that we just 取決於專業水平或根據用戶必須做的工作，他們可以定制用戶體驗他添加了一些新的連接，其中一個是通量連接，如電磁代碼，我們只是 acquired for a low frequency electromagnetic we can now take a flux database and put it into hyper study into your study as well 獲得了一個低頻電磁，我們現在可以採取通量數據庫，並把它進入高速研究","url":"./20170309di-san-zhou.html","tags":"Course"},{"title":"2017/03/02第二週","text":"Solve Space完成四連桿 用solve space完成四連桿圖 Link1(30CM) Link2(50CM) Link3(60CM) 組合圖 心得 由於上課來不及畫完，所以回家自己看著老師的影片，在畫一次，邊畫邊理解又可以順便拍影片，不過想說得是solve space真的不好用，指令就那幾個，有時候還會莫名其妙出現紅色，來回弄了好幾遍，經歷百般波折後還是順利上岸了，第一周完成YA~","url":"./20170302di-er-zhou.html","tags":"Course"}]};